def convert_given_name_to_class_name(given_name: str):
    o = ""
    for char in given_name:
        if char.isalnum() and char not in [" ", "_", "-", ".", ":", ";", ",", "'", '"', "!", "@", "#", "$", "%", "^",
                                           "&", "*", "(", ")", "+", "=", "{", "}", "[", "]", "<", ">", "?", "/", "\\",
                                           "|", "`", "~", "1", "2", "3", "4", "5", "6", "7", "8", "9", "0"]:
            o += char
    given_name_alnum_list = o.lower().capitalize()
    return given_name_alnum_list
